import { Component } from 'react';

import img1 from '../../assets/images/property/img1.jpg';
import img2 from '../../assets/images/property/img2.jpg';
import img3 from '../../assets/images/property/img3.jpg';

class MainLayoutController extends Component {
    constructor(props) {
        super(props);
        this.state ={
            isShowNavigationBar:false,
            isOpenSlider:true,
            forSalesProperties : [
                {'propertyId':1,name:"hello one",image:img1,price:"Thein 1,400"},
                {'propertyId':2,name:"hello two",image:img2,price:"Thein 250"},
                {'propertyId':3,name:"hello three",image:img3,price:"Thein 20,000"},
                {'propertyId':4,name:"hello three",image:img3,price:"Thein 20,000"},
                {'propertyId':5,name:"hello three",image:img3,price:"Thein 20,000"},
                {'propertyId':6,name:"hello three",image:img3,price:"Thein 20,000"},
            ],
        };

        // Variables

        // end Variable
        console.log(this.props);
        console.log('haha');
        this.onNavBarTroggleClick = this.onNavBarTroggleClick.bind(this);
        this.onNavigationIconClick = this.onNavigationIconClick.bind(this);
    }
    onNavigationIconClick(){
        this.setState({
            isShowNavigationBar : !this.state.isShowNavigationBar
        });
    }
    onNavBarTroggleClick(){
        this.setState({
            isOpenSlider : !this.state.isOpenSlider
        });
    }
}

export {MainLayoutController};
